import styles from "./styles.module.css";
import { uuid } from "uuidv4";

const Navigate = ({ way }) => {
  const { uuid } = require("uuidv4");
  return (
    <div className={styles.navigateContainer}>
      {way.map((btn) => {
        return (
          <a key={uuid()} href={`${btn.link}`} className={styles.btnNav}>
            {btn.title}
          </a>
        );
      })}
    </div>
  );
};

export default Navigate;
